    //     })
    //
    //     const data = await res.json();
    //
    //     console.log(data);
    // }

  return (
      <Router>
          <Route path="/api/auth">
              <div className="container">
                  <SignIn loginUser={login}/>
                  <SignUp/>
              </div>
          </Route>
      </Router>
  );
}

export default App;
